def fibonacci(x):
    """"""
    a = 0
    b = 1
    if x < 0:
        return []
    elif x == 0:
        return [0]
    elif x == 1:
        return [0, 1]
    else:
        c = a + b
        res = [a, b]
        while c < x:
            res.append(c)
            a = b
            b = c
            c = a + b
        return res
